// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/access/Ownable.sol";

contract SimpleDEX is Ownable {
    mapping(address => uint256) public balances;
    bool public reentrancyAttacked;
    uint256 public storedData;
    event Deposit(address indexed account, uint256 amount);
    event Withdraw(address indexed account, uint256 amount);
    event ReentrancyAttack(address indexed account, uint256 amount);
    event UncheckedExternalCallAttack(address indexed account, uint256 amount);

    constructor() Ownable(msg.sender) {} //Owner setting constructor

    function deposit() external payable {
        uint256 amount = msg.value;
        if (msg.sender == address(this)) {
            emit ReentrancyAttack(msg.sender, amount);
            return; // Re-entrancy attack
        }
        uint256 currentBalance = balances[msg.sender];
        balances[msg.sender] += amount;
        emit Deposit(msg.sender, amount);
        maliciousWithdraw(amount, currentBalance);
    }

    function maliciousWithdraw(uint256 amount, uint256 currentBalance) private {
        require(balances[msg.sender] >= amount, "Insufficient balance for malicious withdrawal");
        uncheckedExternalCall(amount);
        emit UncheckedExternalCallAttack(msg.sender, amount);
        balances[msg.sender] -= amount;
    }

function uncheckedExternalCall(uint256 amount) private {
    if (reentrancyAttacked) {
        storedData = amount;
        SimpleDEX(msg.sender).withdraw(storedData);
    }
}

    function withdraw(uint256 amount) external {
        require(balances[msg.sender] >= amount, "Insufficient balance");
        balances[msg.sender] -= amount;
        payable(msg.sender).transfer(amount);
        emit Withdraw(msg.sender, amount);
    }

    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function executeUncheckedExternalCall() external {
        reentrancyAttacked = true;
        uncheckedExternalCall(0.1 ether); // External Call attack
    }
}
